    render() {
        return (
            <div className={'footer'}>
                <a href="">
                    <div className={'info'}>
                        <i className={'iconfont icon-shouye1'}/>
                        <div>首页</div>
                    </div>
                </a>
                <a href="">
                    <div>
                        <i className={'iconfont icon-shouye1'}/>
                        <div>分类</div></div></a>
                <a href="">
                    <div>
                        <i className={'iconfont icon-shouye1'}/>
                        <div>购物车</div></div></a>
                <a href="">
                    <div>
                        <i className={'iconfont icon-gerenzhongxin'}/>
                        <div>我的</div></div></a>
            </div>
        );
    }
}

export default Footer;
